import { configureStore } from '@reduxjs/toolkit';
import phonebookReduser from './components/redux/reducers';

 export const reduxToolkitStore = configureStore({
  reducer: {
      phonebook: phonebookReduser,
  }
})

export default reduxToolkitStore;
